async function main() {
  const { command, options } = parseArgs();
  try {
    switch (command) {
      case "generate":
        if (!options.prompt) {
          console.error("Error: --prompt is required for generate command");
          process.exit(1);
        }
        await handleGenerate(options);
        break;
      case "edit":
        if (!options.prompt) {
          console.error("Error: --prompt is required for edit command");
          process.exit(1);
        }
        if (!options.image) {
          console.error("Error: --image is required for edit command");
          process.exit(1);
        }
        await handleEdit(options);
        break;
      case "providers":
        handleProviders();
        break;
      case "health":
        handleHealth();
        break;
      case "help":
      case "--help":
      case "-h":
        handleHelp();
        break;
      default:
        console.error(`Unknown command: ${command}`);
        console.error('Run "image-gen help" for usage information');
        process.exit(1);
    }
  } catch (error) {
    const message = error instanceof Error ? error.message : "Unknown error";
    console.error(JSON.stringify({ success: false, error: message }, null, 2));
    process.exit(1);
  }
}
